func (ext decodeExtension) DecoderOfSlice(typ reflect2.Type) jsoniter.ValDecoder {
	sliceType := typ.(reflect2.SliceType)
	elemType := sliceType.Elem()
	if elemType.Kind() == reflect.Uint8 {
		return nil
	}
	return sliceDecoder{
		sliceType: sliceType,
		elemDec:   ext.LazyDecoderOf(elemType),
	}
}

