	ptrType := reflect2.PtrTo(typ)
	if ptrType.Implements(typerType) {
		return typerEncoder{
			typeEncoder: typeEncoder{ValEncoder: enc},
			typerOf: func(ptr unsafe.Pointer) Typer {
