		elem := dec.elemType.UnsafeNew()
		dec.elemDec.Decode(elem, iter)
		if iter.Error != nil {
			return false
		}

		mapType.UnsafeSetIndex(ptr, key, elem)
		key = nil
		return true
	}) {
		return
	}

	if key != nil {
		iter.ReportError("decode map", "odd number of map items")
