func (ext decodeExtension) DecorateDecoder(typ reflect2.Type, dec jsoniter.ValDecoder) jsoniter.ValDecoder {
	if dec := ext.DecoratorOfRegistered(dec); dec != nil {
		return dec
	}
	if dec := ext.DecoratorOfUnmarshaler(typ, dec); dec != nil {
