func (ext decodeExtension) CreateDecoder(typ reflect2.Type) jsoniter.ValDecoder {
	if dec := ext.DecoderOfRegistered(typ); dec != nil {
		return dec
	}
	if dec := ext.DecoderOfUnmarshaler(typ); dec != nil {
		return dec
	}
	if dec := ext.DecoderOfNative(typ); dec != nil {
		return dec
	}
	switch typ.Kind() {
