func (enc float64Encoder) Encode(ptr unsafe.Pointer, stream *jsoniter.Stream) {
	f := enc.UnsafeIndirect(ptr).(float64)
	switch {
	case math.IsNaN(f):
		stream.WriteString("NaN")
	case math.IsInf(f, 1):
		stream.WriteString("Infinity")
	case math.IsInf(f, -1):
		stream.WriteString("-Infinity")
	default:
		stream.WriteFloat64(f)
	}
}

